import React from 'react';
import {robots} from './robots.js';

const imgArr = [
	{	
		img: 'https://www.metmuseum.org/toah/images/hb/hb_19.164.jpg', 
		text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'
	},{	
		img: 'https://upload.wikimedia.org/wikipedia/commons/d/d8/Pieter_Bruegel_the_Elder_-_Hunters_in_the_Snow_%28Winter%29_-_Google_Art_Project.jpg', 
		text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'
	},{	
		img: '', 
		text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'
	}
]

const textB = [
	' and more on the way',
	' and counting',
	' with ' + Math.round(Math.random()*100)
	+ ','
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9)
	+ ','
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9) 
	+ Math.round(Math.random()*9) 
	+ ' to go'
]

const randB = () => {
	return Math.round(Math.random()*(textB.length - 1));
}

const randC = () => {
	return Math.round(Math.random()*2) + 1;
}

const num = () => {
	return Math.round(Math.random()*(imgArr.length-1));	
}

const Banner = (props) => {
	return (
		<div>
			<div id='spacer'>{robots.length + ' resources' + textB[randB()] + '...'}</div>
			<div 
				className='banner' 
				title={imgArr[num()].text}
				style={{backgroundImage: 'url(\"' + imgArr[0].img + '\")'}}
			>
			</div>
		</div>
	);
}

export default Banner;
